import React from "react";

function CreateAreaColor(props) {
  return (
    <div className="create-color">
      <input
        id="daily"
        type="radio"
        name="period"
        checked={props.period === "DAILY"}
        onChange={() => props.setColor("DAILY")}
      />
      <label htmlFor="daily"></label>
      <input
        id="weekly"
        type="radio"
        name="period"
        checked={props.period === "WEEKLY"}
        onChange={() => props.setColor("WEEKLY")}
      />
      <label htmlFor="weekly"></label>
      <input
        id="monthly"
        type="radio"
        name="period"
        checked={props.period === "MONTHLY"}
        onChange={() => props.setColor("MONTHLY")}
      />
      <label htmlFor="monthly"></label>
      <input
        id="yearly"
        type="radio"
        name="period"
        checked={props.period === "YEARLY"}
        onChange={() => props.setColor("YEARLY")}
      />
      <label htmlFor="yearly"></label>
      <input
        id="yearly"
        type="radio"
        name="period"
        checked={props.period === "YEARLY"}
        onChange={() => props.setColor("YEARLY")}
      />
      <label htmlFor="yearly"></label>
    </div>
  );
}

export default CreateAreaColor;
